import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Home, SOTD, About, Contact } from './modules';
import { Navbar } from './core/components/Navbar';

// Import the new Login and Signup components
import LoginPage from '/Users/ismaelanwarzai/Desktop/SOTD/web/src/core/components/LoginPage';
import SignupPage from '/Users/ismaelanwarzai/Desktop/SOTD/web/src/core/components/SignupPage';

function App() {
  const [darkMode, setDarkMode] = useState(false);

  return (
    <Router>
      <Navbar darkMode={darkMode} />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/sotd" element={<SOTD />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />

        {/* Add the new Login and Signup routes */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignupPage />} />
      </Routes>
    </Router>
  );
}

export default App;
